const AppShellDemo2 = () => {
    const [opened, { toggle }] = useDisclosure();
  return (
    <AppShell
      header={{ height: 60 }}
      padding="md"
    >
      <AppShell.Header>
        <HeaderMenu />
      </AppShell.Header>
      <Grid>
        <Grid.Col span={4}></Grid.Col>
      </Grid>
      
    </AppShell>
  )
}

export default AppShellDemo2
